import React from 'react'
import { connect } from 'react-redux'

const mapDispatchToProps = dispatch => {
    logout: () => {
        dispatch({
            type: 'LOGOUT'    
        })
    }
}

const LogoutButton = props => {
    const logout = () => {
        localStorage.removeItem('token')
        props.logut()
    }
    return(
        <button onClick={logout}>logout</button>
    )
}


export {
    LogoutButton
}
